<!DOCTYPE html>
<html>
    <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no">
    </head>

    <body style="background-color: #f5f9fc; font-family: 'Helvetica Neue', Helvetica, Arial, sans-serif; line-height: 1.5rem; color: #212529; overflow-x:hidden; margin-top: 50px; margin-bottom: 50px;">
        <div style="width:100%; margin-right:auto; margin-left:auto;">
            <div style="text-align: center; display: block;">
                <!--iACADEMY Logo-->
                <img src="data:image/png;base64," alt="iAC" style="width: 90px;">

                <!--iEQUIP Logo-->
                <img src="data:image/png;base64," alt="iEQUIP" style="width: 100px;">
               
            </div>
        </div>

        <div style="position: relative; display: block; margin-top: 10px; margin-left: auto; margin-right: auto; width: 40%; max-height: 100%; padding: 30px 25px; background-color: white;">
            <div>
                <h2 style="padding-bottom: 2px; text-align: center;">Your Feedback Has Been Read!</h2>
                <div style="float: right;">
                <small>{{ date('F d, Y h:i A') }}</small>
            </div>

            <div style="padding-top: 30px;">
                <hr>
                <div style="padding-top:20px; text-align: justify">
                    <small>
                        <p>Good day! Your feedback <b>"{!! $feedbackSubject !!}"</b> has been read by the admin. Please expect a response via email within 1-3 business days.</p>
                        <br>
                        <p>Here's a copy of your submitted feedback for your reference:
                            <br>
                            <span style="color: gray">{!! $feedbackBody !!}</span>
                        </p>
                        <br>
                        <p>We appreciate your patience. If your concern is urgent, please get in touch by calling <b>889 5555 ext. 2234 - 2235</b> or by proceeding to our office located at the 2nd Floor Parking Lot, iACADEMY Nexus.</p>

                        Sincerely,<br>
                        Facilities Department
                    </small>
                </div>
            </div>
        </div>

        <footer style="width:100%; position: absolute; margin-top: 30px;">
            <div>
                <table style="margin: 10px auto; padding-right: 25px;">
                    <thead>
                        <th></th>
                        <th></th>
                    </thead>
                    <tbody>
                        <tr>
                            <td style="text-align: center;">
                                <small style="margin-top: 0;">
                                        &copy;2019 <a href="http://www.iequip.com">iEQUIP</a> | <a href="http://www.iacademy.edu.ph">iACADEMY</a>. All rights reserved.
                                </small>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </footer>
    </body>
</html>
